<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <title>gwada-e-ka</title>
  <base href="/" />
  <meta name="viewport"
    content="viewport-fit=cover, width=device-width, initial-scale=1.0, minimum-scale=1.0, maximum-scale=5.0" />
  <meta name="description" content="This is a gwada-e-ka app" />
  <meta name="theme-color" media="(prefers-color-scheme: dark)" content="#181818" />
  <meta name="theme-color" media="(prefers-color-scheme: light)" content="#f3f3f3" />

  <meta name="apple-mobile-web-app-status-bar-style" content="black" />

  <link href="/assets/styles/gek.css" rel="stylesheet" />
  <script src="/assets/js/jquery-3.2.1.js"></script>
  <link href="/assets/styles/roundsliders.min.css" rel="stylesheet" />

<body>
  <header class="main">
    <img id="name_banner" src="/assets/banners/banner.svg" />
    <input id="settings" type="image" src="/assets/icons/gek_settings_icone_192x192.svg" onclick="setup()"
      style="@font-face {font-family: 'Forte';src: url('/assets/fonts/FORTE.ttf') format('trueType');}" />
  </header>
  <dialog id="setup" class="setup" >
    <div class="settingsBar" id="settingsWindows">
      <form>
        <p>Type de peau: <input type="radio" name="typpo" id="pform1" value="1" onclick="changePoType(this.value)"
            checked /><label for="pform1">Type T</label><input type="radio" name="typpo" id="pform2" value="2"
            onclick="changePoType(this.value)" /><label for="pform2">Type O</label></p>
        <p><label for="checkpo">Peau uniquement:</label><input type="checkbox" name="checkpo" id="checkpo"
            onchange="hideTanbou()" /></p>
        <p><label for="taille">Taille</label><input type="range" id="taille" name="taille" min="20" max="60" value="50"
            onchange="changeTaille(this.value)" /></p>
        <p><label for="vertical">Vertical</label><input type="range" id="vertical" name="vertical" min="0" max="20"
            value="3" onchange="changeVertical(this.value)" /></p>
      </form>
      <div class="soundsettingsBar">
        <span class="soundsettings">Volume:<div id="volume"></div></span>
        <span class="soundsettings">Bass:<div id="grave"></div></span>
        <span class="soundsettings">Mid:<div id="medium"></div></span>
        <span class="soundsettings">Treble:<div id="aigu"></div></span>
        <div class="reverb" id="convolver">
          <label for="reverbs">Reverb:</label>
          <select id="reverbs" name="reverbs">
            <option value="off">Off</option>
            <option value="small_bright">Small Bright</option>
            <option value="medium_bright">Medium Bright</option>
            <option value="large_bright">Large Bright</option>
            <option value="medium_warm">Medium Warm</option>
            <option value="large_warm">Large Warm</option>
            <option value="xlarge_warm">Xlarge Warm</option>
            <option value="medium_dark">Medium Dark</option>
            <option value="large_dark">Large Dark</option>
            <option value="multitap_reverse_pan">multitap_reverse_pan</option>
            <option value="reverser">reverser</option>
          </select>
        </div>
      </div>
    </div>
  </dialog>

  <div id="regieTop" class="regie">

  </div>

            startAngle: 90,
            endAngle: "+360"
          });

        $("#grave, #medium, #aigu").each(function () {
          $(this).roundSlider({
            min: -10,
            max: 10,
            step: 1,
            value: 0,
            radius: 25,
            width: 10,
            handleSize: "+0",
            sliderType: "default",
            startAngle: -90,
            endAngle: "+360"
          });
        });

        let audioCtx;
        let mainGainNode;
        let biquadFilterLow;
        let biquadFilterMid;
        let biquadFilterTreb;
        let convolver;
        
        let impulseFileName;
        let impulseFileNamePrevious;
        let impulse;


        const sizeControlValue = document.querySelector("input[name='taille']");
        const verticalControlValue = document.querySelector("input[name='vertical']");
        const checkbutton = document.querySelector("input[name='checkpo']");
        const volumeControl = document.querySelector("input[name='volume']");
        const filterLowControl = document.querySelector("input[name='grave']");
        const filterMidControl = document.querySelector("input[name='medium']");
        const filterTrebControl = document.querySelector("input[name='aigu']");
        const convolverTypeControl = document.querySelector("select[name='reverbs']");

        const tanbou = document.getElementById("tanbou");
        const gabarit = document.getElementById("svg1");
        const fut = document.getElementById("Fut");
        const anneaux = document.getElementById("Anneaux");
        const cordes_inf = document.getElementById("Cordes inférieurs");
        const cles = document.getElementById("Clés");
        const cordes = document.getElementById("Cordes");

        if (null != localStorage.getItem("poType")) {
          let typeChoice = JSON.parse(localStorage.getItem("poType"));
          const poTypeControl = document.querySelector("input[id='pform" + typeChoice + "']");
          poTypeControl.checked = true
          changePoType(typeChoice);
        }

        if (null != localStorage.getItem("isHide")) {
          checkbutton.checked = JSON.parse(localStorage.getItem("isHide"));
          hideTanbou();
        }

        if (null != localStorage.getItem("sizeconf")) {
          let memVal = localStorage.getItem("sizeconf");
          gabarit.style.setProperty("--gabarit", memVal + "em"); 
          sizeControlValue.setAttribute("value", memVal.replace('em', ''));
        }

        if (null != localStorage.getItem("verticalconf")) {
          let memVal = localStorage.getItem("verticalconf");
          tanbou.style.setProperty("--vert", memVal + "em");
          verticalControlValue.setAttribute("value", memVal.replace('em', ''));
        }

        if (null != localStorage.getItem("filterLowControlValue")) {
          $("#grave").roundSlider("option", "value", JSON.parse(localStorage.getItem("filterLowControlValue")));
        }

        if (null != localStorage.getItem("filterMidControlValue")) {
          $("#medium").roundSlider("option", "value", JSON.parse(localStorage.getItem("filterMidControlValue")));
        }

        if (null != localStorage.getItem("filterTrebControlValue")) {
          $("#aigu").roundSlider("option", "value", JSON.parse(localStorage.getItem("filterTrebControlValue")));
        }

        if (null != localStorage.getItem("volumeControlValue")) {
          $("#volume").roundSlider("option", "value", JSON.parse(localStorage.getItem("volumeControlValue")));
        }

        if (null != localStorage.getItem("convolverControlValue")) {
          convolverTypeControl.value = localStorage.getItem("convolverControlValue");
        }

        function changeTaille(val) {
          gabarit.style.setProperty("--gabarit", val + "em");
          localStorage.setItem("sizeconf", val );
        }

        function changeVertical(val) {
          tanbou.style.setProperty("--vert", val + "em");
          localStorage.setItem("verticalconf", val);
        }

        function hideTanbou() {
          if (checkbutton.checked) {
            fut.style.display = "none";
            anneaux.style.display = "none";
            cordes_inf.style.display = "none";
            cles.style.display = "none";
            cordes.style.display = "none";
          } else {
            fut.style.display = "inline";
            anneaux.style.display = "inline";
            cordes_inf.style.display = "inline";
            cles.style.display = "inline";
            cordes.style.display = "inline";
          }
          localStorage.setItem("isHide", checkbutton.checked);
        }

        function setup() {
          let menu = document.getElementById("setup");
          let state = menu.getAttribute("style");
          if (!(menu.open)) {
            menu.show();
            sizeControlValue.setAttribute("value", getComputedStyle(gabarit).getPropertyValue("--gabarit").replace('em', ''));
            verticalControlValue.setAttribute("value", getComputedStyle(tanbou).getPropertyValue("--vert").replace('em', ''));
          } else {
            localStorage.setItem("filterLowControlValue", filterLowControl.value);
            localStorage.setItem("filterMidControlValue", filterMidControl.value);
            localStorage.setItem("filterTrebControlValue", filterTrebControl.value);
            localStorage.setItem("volumeControlValue", volumeControl.value);
            localStorage.setItem("convolverControlValue", convolverTypeControl.value);
            localStorage.setItem("sizeconf", getComputedStyle(gabarit).getPropertyValue("--gabarit").replace('em', ''));
            localStorage.setItem("verticalconf", getComputedStyle(tanbou).getPropertyValue("--vert").replace('em', ''));
            localStorage.setItem("poType", document.querySelector("input[name=typpo]:checked").value);
            localStorage.setItem("isHide", checkbutton.checked);
            menu.close();
          }
        }

        function changePoType(obj) {
          const poType = document.getElementById("layerPeau" + obj);
          poType.setAttribute("style", "display:inline");
          if (1 != obj) {
            document.getElementById("layerPeau1").setAttribute("style", "display:none");
          }
          if (2 != obj) {
            document.getElementById("layerPeau2").setAttribute("style", "display:none");
          }
          localStorage.setItem("poType", obj);
        }

        function joueka(evt) {
          let audio = new Audio("/assets/audio/" + evt + ".wav");
          if (!(audioCtx)) {
            audioCtx = new (window.AudioContext || window.webkitAudioContext)();
          }
          if (!(mainGainNode)) {
            mainGainNode = audioCtx.createGain();
          }
          if (!(biquadFilterLow)) {
            biquadFilterLow = audioCtx.createBiquadFilter();
          }
          if (!(biquadFilterMid)) {
            biquadFilterMid = audioCtx.createBiquadFilter();
          }
          if (!(biquadFilterTreb)) {
            biquadFilterTreb = audioCtx.createBiquadFilter();
          }          

          function changeVolume(event) {
            mainGainNode.gain.value = 0.5 * volumeControl.value;
          }

          function changeFilterLow(event) {
            biquadFilterLow.gain.value = filterLowControl.value;
          }
          biquadFilterLow.type = "lowshelf";
          biquadFilterLow.frequency.value = 150;

          function changeFilterMid(event) {
            biquadFilterMid.gain.value = filterMidControl.value;
          }
          biquadFilterMid.type = "peaking";
          biquadFilterMid.frequency.value = 1500;
          biquadFilterMid.Q = 0.5;

          function changeFilterTreb(event) {
            biquadFilterTreb.gain.value = filterTrebControl.value;
          }
          biquadFilterTreb.type = "highshelf";
          biquadFilterTreb.frequency.value = 5000;

          function changeConvolverType(event) {
            impulseFileName = "off" != convolverTypeControl.value ? "/assets/audio/" + convolverTypeControl.value + ".wav" : '';
          }

          volumeControl.addEventListener("change", changeVolume, false);
          filterLowControl.addEventListener("change", changeFilterLow, false);
          filterMidControl.addEventListener("change", changeFilterMid, false);
          filterTrebControl.addEventListener("change", changeFilterTreb, false);
          convolverTypeControl.addEventListener("change", changeConvolverType, false);

          biquadFilterLow.gain.value = filterLowControl.value;
          biquadFilterMid.gain.value = filterMidControl.value;
          biquadFilterTreb.gain.value = filterTrebControl.value;
          mainGainNode.gain.value = 0.5 * volumeControl.value;

          localStorage.setItem("filterLowControlValue", filterLowControl.value);
          localStorage.setItem("filterMidControlValue", filterMidControl.value);
          localStorage.setItem("filterTrebControlValue", filterTrebControl.value);
          localStorage.setItem("volumeControlValue", volumeControl.value);
          localStorage.setItem("convolverControlValue", convolverTypeControl.value);

          const source = audioCtx.createMediaElementSource(audio);
          source.connect(biquadFilterLow);
          biquadFilterLow.connect(biquadFilterMid);
          biquadFilterMid.connect(biquadFilterTreb);

          if (("off" != convolverTypeControl.value)){
            if (!(convolver)){
              convolver = audioCtx.createConvolver();
            }            
            impulseFileName = "off" != convolverTypeControl.value ? "/assets/audio/" + convolverTypeControl.value + ".wav" : '';
            impulse = (impulseFileNamePrevious != impulseFileName) ? fetch(impulseFileName).then(response => response.arrayBuffer()).then(buffer => audioCtx.decodeAudioData(buffer)).then(buffer => {convolver.buffer = buffer;}) : null;
            biquadFilterTreb.connect(convolver);
            convolver.connect(mainGainNode);
          } else {
            if (convolver) {
              convolver.disconnect();            
            }
            biquadFilterTreb.connect(mainGainNode);
          }
          
          impulseFileNamePrevious = impulseFileName;

          mainGainNode.connect(audioCtx.destination);
          audio.play();
        }

        window.addEventListener("keydown", function (event) {
          let key = event.key;
          switch (key) {
            case 'a':
              joueka("bass");
              break;
            case 'A':
              joueka("bass");
              break;
            case 'z':
              joueka("medium");
              break;
            case 'Z':
              joueka("medium");
              break;
            case 'e':
              joueka("zoban");
              break;
            case 'E':
              joueka("zoban");
              break;
            default:
              break;
          }
        })        
      ]]>
      </script>
    </svg>
    <script>
      if ('serviceWorker' in navigator) {
        navigator.serviceWorker.register(
          '/sw.js'
        );
      }
    </script>
  </div>
